import React from "react";
import './index.css'
function Card(props) {
    return (
        <div>
            <h1 className="heading">My Contacts</h1>
            <div className="card">
                <div className="top">
                    <h2 className="heading">{props.name}</h2>
                    <img src={props.img} alt="Avatar_img"></img>
                    
                    <p>{props.phone}</p>
                    <p>{props.email}</p>
                </div>
            </div>
            
        </div>
    )
}
export default Card;
